import React from 'react';
import doodle from "../../../image/doodle.png";
import clickable from "../../../image/clickable.png";
import saly from "../../../image/saly.png";
import {StyleSheet, css} from 'aphrodite';
import Text from "../../helpers/Text";
import Buttons from "../../helpers/Buttons";

function Price(props) {
    const style = StyleSheet.create({
        doodle: {
            bottom:"150%",
            left:"25%"
        },
        relative: {
            position: "relative",
        },
        clickable: {
            bottom:"100%",
        },
        saly: {
            bottom:"100%",
            left: "200px"
        },
        prices :{
            height:"100%",
            alignItems:"center",
            justifyContent:"center"
        }
    })
    return (
        <div style={{
            flex: 0.6
        }}>
        <div className={css(style.prices) + " col"}>
            <Text text="PRICE FUCKY"></Text>
            <Buttons nameOfButton="Купить"></Buttons>
        </div>
            <img className={css(style.doodle, style.relative)} src={doodle}/>
            <img className={css(style.clickable, style.relative)} src={clickable}/>
            <img className={css(style.saly, style.relative)} src={saly}/>
        </div>
    );
}

export default Price;
